<div class="bodyDecrypted email message-body-container" ng-class="{'plain': message.isPlain}" render-message-body=""
     ng-if="message.viewMode === 'html' &amp;&amp; !message.failedDecryption" toggle-blockquote="" scroll="true">
    <table width="100%" cellspacing="0" cellpadding="0" bgcolor="#f4f4f4">
        <tbody>
        <tr>
            <td style="padding:80px 10px 40px;">
                <table width="640" align="center" cellpadding="0" cellspacing="0" style="margin:0 auto;">
                    <tbody>
                    <tr>
                        <td>
                            <table width="640" cellpadding="0" cellspacing="0" style="width:640px !important;">
                                <tbody>
                                <tr>
                                    <td style="min-width:640px; font-size:0; line-height:0;">&nbsp;</td>
                                </tr>
                                </tbody>
                            </table>
                        </td>
                    </tr>
                    <tr>
                        <td style="border:1px solid #e7e7e7; border-radius:6px 6px 0 0;">
                            <table width="100%" cellpadding="0" cellspacing="0">

                                <tbody>
                                <tr>
                                    <td bgcolor="#8c9ddc"
                                        style="background:#8c9ddc url(data:image/png;base64,) top center no-repeat;background-position:top center;background-size: cover; background-repeat:no-repeat; border-bottom:1px solid #e7e7e7; border-radius:6px 6px 0 0;"
                                        data-hash="ptnpi4ombe0c-1577703110883"
                                        background="https://static.uniregistry.com/assets/img/email/signup-header.jpg">

                                        <table width="100%" cellpadding="0" cellspacing="0">
                                            <tbody>
                                            <tr>
                                                <td height="30" colspan="3"></td>
                                            </tr>
                                            <tr>
                                                <td width="50"></td>
                                                <td valign="top">
                                                    <table width="100%" cellpadding="0" cellspacing="0">

                                                        <tbody>
                                                        <tr>
                                                            <td align="center" style="padding:0 0 40px;">
                                                                <a target="_blank" style="text-decoration:none;"
                                                                   href="https://uniregistry.com"
                                                                   rel="noreferrer nofollow noopener"></a>
                                                            </td>
                                                        </tr>
                                                        <tr>
                                                            <td align="center" height="108"
                                                                style="font:30px/36px Open Sans, Arial, Verdana, sans-serif; color:#fff; font-weight:300; padding:0 20px;">{{$name}}</td>
                                                        </tr>

                                                        </tbody>
                                                    </table>
                                                </td>
                                                <td width="50"></td>
                                            </tr>
                                            <tr>
                                                <td height="84" colspan="3"></td>
                                            </tr>
                                            </tbody>
                                        </table>

                                    </td>
                                </tr>

                                <tr>
                                    <td bgcolor="#ffffff" style="padding:15px 19px 21px;">
                                        <table width="100%" cellpadding="0" cellspacing="0">

                                            <tbody>
                                            <tr>
                                                <td style="font:14px/19px Open Sans, Arial, Verdana, sans-serif; color:#5c5c5c; font-weight:300; padding:0 0 19px;">{{$content}}
                                                    <br><br><br></td>
                                            </tr>


                                            <tr>
                                                <td style="padding:0 0 27px;">
                                                    <table cellpadding="0" cellspacing="0" align="center"
                                                           style="margin:0 auto !important;">
                                                        <tbody>
                                                        <tr>
                                                            <td style="font:14px/16px Open Sans, Arial, Verdana, sans-serif; color:#fff; mso-padding-alt:12px 18px; border-radius:5px;"
                                                                bgcolor="#05365d">
                                                                <a target="_blank"
                                                                   style="text-decoration:none; color:#fff; display:block; padding:12px 18px;"
                                                                   href="{{$url}}">{{$name}}</a>
                                                            </td>
                                                        </tr>
                                                        </tbody>
                                                    </table>
                                                </td>
                                            </tr>


                                            </tbody>
                                        </table>
                                    </td>
                                </tr>


                                </tbody>
                            </table>
                        </td>
                    </tr>

                    <tr>
                        <td style="padding:23px 26px;">
                        </td>
                    </tr>
                    </tbody>
                </table>
            </td>
        </tr>
        <tr>
            <td>
                <div style="display:none; white-space:nowrap; font:15px/4px courier; color:transparent;">- - - - - - - -
                    - - - - - - - - - - - - - - - - - - - - - - - - - - -
                </div>
            </td>
        </tr>
        </tbody>
    </table>

</div>
